      <option value={size} key={size}>{size}</option>
    )
  ;


    return(
      <>
        <h2>Available Tables</h2>
        <form>
          <select id="party-size-selector">
            <option>
              {partySize}
            </option>
          </select>
        </form>
      </>
    );
};
export default TableForm;
